import { CarViewRow } from "./CarViewRow.js";

export const CarTable = (props) => {
    return (
        <table>
            <thead>
                <tr>
                    <th>ID</th>
                    <th>MAKE</th>
                    <th>MODEL</th>
                    <th>YEAR</th>
                    <th>COLOR</th>
                    <th>PRICE</th>
                </tr>
            </thead>
            <tbody>
                { props.cars.map(car => <CarViewRow car={car}></CarViewRow>) }
            </tbody>
        </table>
    );
};
